import React from "react";
import Sidenav from "./Sidenav";
import Box from "@material-ui/core/Box";
import "./Person.css";
const url = "http://localhost:8000/api/persons";


export default function PersonPage() {
    var page = 0;
    var no_per_page = 10;
    function showAll() {
        fetch(url + "/get/" + page + "/" + no_per_page,{
            method: "GET",
            headers: {
                Accept: "application/json",
                Authorization: "Bearer " + localStorage.getItem("token"),
            }
        })
        .then((res) => res.json())
        .then((data) => {
            console.log(data);
        });
    }
    return (
        <div className="PersonsPage">
            <Sidenav/>
            <main>
                <Box variant="contained" className="buttonPerson">Add new person</Box>
                <Box variant="contained" className="buttonPerson" onClick={showAll}>Show all</Box>
            </main>
        </div>
    );
}
